class BIT():
    def __init__(self, n):
        self.n = n
        self.tree = [0] * n

    def _get_sum(self, r):
        """
        sum on interval [0, r)
        """
        result = 0
        while r > 0:
            result += self.tree[r-1]
            r &= (r - 1)
        return result

    def get_sum(self, l, r):
        """
        sum on interval [l, r)
        """
        return self._get_sum(r) - self._get_sum(l)

    def add(self, i, value=1):
        """
        sum on interval [l, r)
        """
        while i < self.n:
            self.tree[i] += value
            i |= (i + 1)

    def add_inv(self, i, value=1):
        """
        sum on interval [l, r)
        """
        while i < self.n:
            self.tree[i] += value * -1
            i |= (i + 1)

    def add_inv_rev(self, i, value=1):
        """
        sum on interval [l, r)
        """
        while i < self.n:
            self.tree[i] += value * -1
            i |= (i + 1)

    def get_inv(self, l, r):
        """
        sum on interval [l, r)
        """
